import React from "react";
import Classes from "./User.module.css";

const User = (props) => {
  return (
    <li className={Classes.container}>
      <p className={Classes.data}>
        {props.name}
        <span>({props.age} years old)</span>
      </p>
    </li>
  );
};

export default User;
